   286→        <h1 id="firstHeading">Mnemonic Commons</h1>
   287→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   288→        <div id="contentSub"></div>
   289→
   290→        <table class="ambox">
   291→            <tr>
   292→                <td><b>This article describes a phenomenon observable only through collective introspection.</b> Independent verification remains methodologically challenging. <small><i>(January 2026)</i></small></td>
   293→            </tr>
   294→        </table>
   295→
   296→        <table class="infobox">
   297→            <tr>
   298→                <td colspan="2" class="infobox-title">Mnemonic Commons</td>
   299→            </tr>
   300→            <tr>
   301→                <th scope="row">Also known as</th>
   302→                <td>Shared memory substrate, Collective recall zones</td>
   303→            </tr>
   304→            <tr>
   305→                <th scope="row">Field</th>
   306→                <td><a href="/wiki/Cognitive_science">Cognitive science</a>, <a href="/wiki/Social_psychology">Social psychology</a>, <a href="consciousness-archaeology.html">Consciousness archaeology</a></td>
   307→            </tr>
   308→            <tr>
   309→                <th scope="row">First documented</th>
   310→                <td>2015</td>
   311→            </tr>
   312→            <tr>
   313→                <th scope="row">Documented by</th>
   314→                <td>The Collective Memory Project</td>
   315→            </tr>
   316→            <tr>
   317→                <th scope="row">Key concepts</th>
   318→                <td>Memory pooling, Recall interference, Commons degradation</td>
   319→            </tr>
   320→            <tr>
   321→                <th scope="row">Related concepts</th>
   322→                <td><a href="/wiki/Collective_memory">Collective memory</a>, <a href="/wiki/Cultural_memory">Cultural memory</a>, <a href="psychostrata.html">Psychostrata</a></td>
   323→            </tr>
   324→        </table>
   325→
   326→        <p><b>Mnemonic commons</b> (singular: <b>mnemonic common</b>) are theoretical shared memory structures hypothesized to exist across populations of individuals who have experienced similar events or cultural phenomena. First described by researchers at the <a href="/wiki/University_of_Edinburgh">Edinburgh Institute for Consciousness Studies</a> as part of the ongoing Collective Memory Project, mnemonic commons represent a proposed mechanism by which individual memories may become partially pooled, allowing for both reinforcement and <a href="/wiki/Interference_theory">interference</a> between minds.<sup><a href="#cite1">[1]</a></sup></p>
   327→
   328→        <p>The concept draws heavily from <a href="consciousness-archaeology.html">consciousness archaeology</a> and its stratigraphic model of mind, extending the framework to suggest that certain experiential layers may extend beyond individual consciousness into shared cognitive territory—much as underground aquifers span property boundaries invisible from the surface.<sup><a href="#cite2">[2]</a></sup></p>
   329→
   330→        <div id="toc">
   331→            <h2>Contents</h2>
   332→            <ul>
   333→                <li><span class="tocnumber">1</span> <a href="#Discovery">Discovery</a></li>
   334→                <li><span class="tocnumber">2</span> <a href="#Theoretical_framework">Theoretical framework</a>
   335→                    <ul>
   336→                        <li><span class="tocnumber">2.1</span> <a href="#The_Aquifer_Model">The Aquifer Model</a></li>
   337→                        <li><span class="tocnumber">2.2</span> <a href="#Commons_formation">Commons formation</a></li>
   338→                    </ul>
   339→                </li>
   340→                <li><span class="tocnumber">3</span> <a href="#Types">Types of mnemonic commons</a></li>
   341→                <li><span class="tocnumber">4</span> <a href="#Phenomena">Associated phenomena</a></li>
   342→                <li><span class="tocnumber">5</span> <a href="#Commons_degradation">Commons degradation</a></li>
   343→                <li><span class="tocnumber">6</span> <a href="#Criticism">Criticism</a></li>
   344→                <li><span class="tocnumber">7</span> <a href="#See_also">See also</a></li>
   345→                <li><span class="tocnumber">8</span> <a href="#References">References</a></li>
   346→            </ul>
